Before, Rollkit only supported the use of a single sequencer that was responsible for creating a list of transactions by reaping its mempool, executing them to produce a header, and putting them together in a block. Rollkit headers and data were encapsulated within a single block structure. The block struct looked like this: // Block defines the structure of Rollkit block.
type Block struct { SignedHeader SignedHeader Data Data
} The separation of header and data into distinct structures allows them to be processed independently. The SignedHeader struct now focuses on the header information, while the Data struct handles transaction data separately. This separation is particularly beneficial in unlocking based sequencing, where users submit transactions directly to the Data Availability layer which acts as the entity responsible for creating the list of transactions. classDiagram class Block { SignedHeader Data } class SignedHeader { Header Signature } class Header { ParentHash Height Timestamp ChainID DataCommitment StateRoot ExtraData } class Data { Metadata Txs } Block *-- SignedHeader Block *-- Data SignedHeader *-- Header This change also affects how full nodes sync. Previously, full nodes would apply the transactions from the Block struct and verify that the header in SignedHeader matched their locally produced header. Now, with the separation, full nodes obtain the transaction data separately (via the DA layer directly in based sequencer mode, or via p2p gossip/DA layer in single sequencer mode) and verify it against the header signed by the header producer once they have both components. If a full node receives the header/data via a p2p gossip layer, they should wait to see the same header/data on the DA layer before marking the corresponding block as finalized in their view. This ensures that the data integrity and consistency are maintained across the network. // SignedHeader struct consists of the header and a signature
type SignedHeader struct { Header // Rollkit Header Signature Signature // Signature of the header producer ...
} // Header struct focusing on header information
type Header struct { // Hash of the previous block header. ParentHash Hash // Height represents the block height (aka block number) of a given header Height uint64 // Block creation timestamp Timestamp uint64 // The Chain ID ChainID string // Pointer to location of associated block data aka transactions in the DA layer DataCommitment Hash // Commitment representing the state linked to the header StateRoot Hash // Arbitrary field for additional metadata ExtraData []byte
} // Data defines Rollkit block data.
type Data struct { *Metadata // Defines metadata for Data struct to help with p2p gossiping. Txs Txs // List of transactions to be executed
} The publishBlock method in manager.go now creates the header and data structures separately. This decoupling allows for the header to be submitted to the DA layer independently of the block data, which can be built by a separate network. This change supports the transition from a single sequencer mode to a decentralized sequencer mode, making the system more modular.

